  true,\n\t\"url\": null,\n\t\"notes\": \"The National Weather Service (NWS) Storm
  Prediction Center (SPC) routinely collects reports of severe weather and compiles
  them with public access from the database called SeverePlot (Hart and Janish 1999)
  with a Graphic Information System (GIS).  The composite SVRGIS information is made
  available to the public primarily in .zip files of approximately 50MB size.  The
  files located at the access point have organized severe weather data by County Warning
  Area (CWA).  A CWA is a grouping of counties for which severe weather information
  is distributed.  Although available to all, the data provided may be of particular
  value to weather professionals and students of meteorological sciences.  An instructional
  manual is provided on how to build and develop a basic severe weather report GIS
  database in ArcGis and is located at the technical documentation site contained
  in this metadata catalog.\",\n\t\"license_title\": \"Creative Commons Attribution\",\n\t\"extras\":
